import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
    {/* <div className="container"> */}
    <div className="left_navbar">
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/blogs">Blogs</Link>
          </li>
          <li>
            <Link to="/contact">Contact</Link>
          </li>
        </ul>
      </nav>

    </div>
    <div>
      <Outlet />
    </div>
    {/* </div> */}
    </>
  )
};

export default Layout;
